@Override
public String toString()
{
  StringBuilder str = new StringBuilder();
  str.append( "[" );
  for( int i=0; i<size; i++ ) {
    if( i > 0 ) {
      str.append( "," );
    }
    str.append( data[convert(i)] );
  }
  str.append( "]" );
  return str.toString();
}

